import React, { useState, useEffect, useCallback  } from 'react';
import { io } from 'socket.io-client';

const ios = new Server({
    cors: {
      origin: "http://localhost:5000"
    }
  });
  
  ios.listen(5000);

function Example() {
  const [data, setData] = useState([]);

  useEffect(() => {
    async function fetchData() {
      const result = await fetch(`http://localhost:5000`);
      const body = await result.json();
      setData(body);
    }
    fetchData();
  }, []);

  return <div>      <tbody>
  <tr>
<th>FÃ¶rnamn</th>
<th>Efternamn</th> 
<th>Personnummer</th>
<th>Tid in</th>
</tr>
{data.map((item) => (
<tr>
<td key={item.id}>{item.fornamn}</td>
<td key={item.id}>{item.efternamn}</td>
<td key={item.id}>{item.personnummer}</td>
<td key={item.id}>{item.tidin}</td>
</tr>
))}
  </tbody></div>;
}


export default Example;
